// Profile.js

import React, { useState, useEffect } from "react";
import defaultUserImage from "../assets/defaultUserImage.png"; // Import your default user image
import "./Profile.css";

const Profile = () => {
  const [userData, setUserData] = useState({
    username: "Default Username",
    name: "Default Name",
    email: "default@example.com",
    // Add other user data fields as needed
  });

  // Simulate fetching user data from the database
  useEffect(() => {
    // Assume fetchUserData is a function to fetch user data from the database
    // Replace this with actual fetch logic
    const fetchUserData = async () => {
      try {
        // Simulate API call or database query
        const response = await fetch("/api/user"); // Replace with actual API endpoint
        const data = await response.json();

        // Update state with fetched user data
        setUserData(data);
      } catch (error) {
        console.error("Error fetching user data:", error);
      }
    };

    fetchUserData();
  }, []);

  return (
    <div className="profile-card">
      <img
        src={userData.image || defaultUserImage}
        alt="User Profile"
        className="profile-image"
      />
      <div className="user-details">
        <h2>{userData.username}</h2>
        <p>Name: {userData.name}</p>
        <p>Email: {userData.email}</p>
        {/* Add other user details here */}
      </div>
    </div>
  );
};

export default Profile;
